import logo from './logo.svg';
import './App.css';
import Layout from './views/layout';
import { Route, Routes } from 'react-router-dom';

function App() {
  return (
    <div>
      <Routes>
       <Route path='/' element={<Layout />}/>
       <Route path = '/About_Me' element = {<Layout></Layout>} />
      </Routes>
    </div>
  );
}

export default App;
